import React from 'react';

function ActiveFriends(props){
  return(
    <div>
      <h2>Active Friends</h2>
      {props.activeList.map((list,index)=>(
        <div key={index}>
          {list.name}

          <button>Make Inactive</button>
        </div>  
      )
      )}
    </div>
  )
}


export default ActiveFriends;
